import React,{useState} from 'react';


const Register = () => {
  const initial = {
    pincode:"",branchName:"",place:"",name:"",password:"",cpassword:""
  }
  const [branchInfo,setBranchInfo] = useState(initial);

  let name,value;

  const handleInputs =(e) =>{
    console.log(e);
    name = e.target.name;
    value = e.target.value;

    setBranchInfo({...branchInfo,[name]:value})
  }



  return (
    <div>
      <h1>From Register Page</h1>
      <div>
          <form>
              <label>Pincode</label>
              <input type="text" name="pincode" id="pincode" value ={branchInfo.pincode} placeholder='Enter pincode' onChange={handleInputs}></input>
              <label>BranchName</label>
              <input type="text" name="branchName" id="branchName" value ={branchInfo.branchName} placeholder='Enter branch Name' onChange={handleInputs}></input>
              <label>Place</label>
              <input type="text" name="place" id="place" value ={branchInfo.place} placeholder='Enter place of branch' onChange={handleInputs}></input>
              <label>User Name :</label>
              <input type="text" name="name" id="name" value ={branchInfo.name} placeholder='Enter User Name' onChange={handleInputs}></input>
              <label>Password</label>
              <input type="password" name="password" id="password" value ={branchInfo.password} placeholder='Enter password you want to assign' onChange={handleInputs}></input>
              <label>Confirm Password</label>
              <input type="cpassword" name="cpassword" id="cpassword" value ={branchInfo.cpassword} placeholder='Enter password again' onChange={handleInputs}></input>
          </form>
          <button>Submit</button>
      </div>
    </div>
  )
}

export default Register
